// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity 0.8.15;

import {UncheckedDemo} from "./UncheckedDemo.sol";
import {ERC20DetailedDemo} from "./ERC20DetailedDemo.sol";

contract BeforeTokenDemo is UncheckedDemo, ERC20DetailedDemo {

    uint8 public constant DECIMALS = 18;
    uint256 public constant INITIAL_SUPPLY = 10000 * (10 ** uint256(DECIMALS));

    /**
     * @dev Constructor that gives msg.sender all of existing tokens.
     */
    constructor () public ERC20DetailedDemo("SimpleToken", "SIM", DECIMALS) {
        uncheckedMint(msg.sender, INITIAL_SUPPLY);
    }
}

tests/ERC20DetailedDemo.sol.content:
// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity 0.8.15;


contract ERC20DetailedDemo {

    string private _name;
    string private _symbol;
    uint8 private _decimals;

    /**
     * @dev Sets the values for `name`, `symbol`, and `decimals`. All three of
     * these values are immutable: they can only be set once during
     * construction.
     */
    constructor (string memory name, string memory symbol, uint8 decimals) public {
        _name = name;
        _symbol = symbol;
        _decimals = decimals;
    }

}

tests/UncheckedDemo.sol.content:
// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity 0.8.15;

contract UncheckedDemo {

    event Transfer(address indexed from, address indexed to, uint256 amount);

    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;

    // use modifier logs_gas: 12501 gas
    // transaction cost:37080 gas
    function checkedMint(address to, uint256 amount) public { 
        totalSupply += amount;
        balanceOf[to] += amount;

        emit Transfer(address(0), to, amount);
    }

    // use modifier logs_gas: 12313 gas, but is 46513 when first called.
    // transaction cost: 36870 gas
    function uncheckedMint(address to, uint256 amount) public { 
        totalSupply += amount;

        // Cannot overflow because the sum of all user
        // balances can't exceed the max uint256 value.
        unchecked {
            balanceOf[to] += amount;
        }

        emit Transfer(address(0), to, amount);
    }
}

